  `wap_display` int(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=38 DEFAULT CHARSET=utf8 COMMENT='产品表' ;

# 数据库表：pa_report 结构信息
DROP TABLE IF EXISTS `pa_report`;
