&nbsp;<br />
<strong>项目介绍</strong><br />
<strong>Project Introduction</strong><br />
&nbsp; &nbsp; &nbsp; BlockWorld是一个由币圈、链圈、矿圈三圈合一组成闭环的加密数字资产生态系统，将项目方、代投机构、数字货币交易所、媒体资源、粉丝社区、矿场建设融合在一起，旨在打造一个增强的去中心化全球算力资源平台。BlockWorld投资区块链基础算力设施，包括矿场建设、矿场运营、算力累积、算力出租、Token空投等业务。BlockWorld负责在世界各地建设和运营算力，以现有矿场的算力为基础，同时不断在全球开发新的矿机算力，提升用户挖矿体验，让更少的资源消耗创造出更大的价值。用户通过GPU挖矿 、FPGA挖矿 、ASIC挖矿 、大规模集群挖矿等获得算力和算力对应的收益。BlockWorld愿景目标是成为全球专业矿场运营团队，在矿场建设、矿场运营、算力投资、算力出租、设备采购等方面做到专业、可靠。<br />
&nbsp;<br />
<strong>算力投资</strong><br />
<strong>Investment in calculation</strong><br />
<span>&nbsp; &nbsp; &nbsp;&nbsp;</span>算力 ，英文名为hash power或hash rate，就是利用一定的资源挖到虚拟货币的概率以比特币为例，在通过“挖矿”得到比特币的过程中，我们需要找到其相应的解m，而对于任何一个六十四位的哈希值，要找到其解m，都没有固定算法，只能靠计算机随机的hash碰撞，而一个挖矿机每秒钟能做多少次hash碰撞，就是其“算力”的代表，单位写成hash/s，这就是所谓工作量证明机制POW(Proof Of Work)。<br />
<span>&nbsp; &nbsp; &nbsp;&nbsp;</span>算力 ，正是人们获得数字货币的一种重要手段。<br />
目前全球算力正逐步走向集中，普通民众挖矿成本越来越高，blockworld团队凭借丰富的矿场运营经验，利用全球资源优势，实现矿场的全球化布局，使普通民众可以低成本轻松参与数字资产挖矿。<br />
数据显示，相比二级市场交易和一级市场项目投资，挖矿的收益会更直观稳健，风险会更小。而当数字资产概念普遍化、规模扩大化之后，稳健的投资方法将会是多数人的选择。<br />
<span>&nbsp; &nbsp; &nbsp;&nbsp;</span>投资算力是你可以选择的稳健性数字货币投资方式。<br />
<span>&nbsp; &nbsp; &nbsp;&nbsp;</span>本项目不仅会投资算力基础设施，同时会投资算力，为投资者提供稳健的数字货币投资选择。<br />
&nbsp;<br />
<strong>收入来源</strong><br />
<strong>Source of Income</strong><br />
<span>&nbsp; &nbsp; &nbsp;&nbsp;</span>云端挖矿 &nbsp;算力即买即挖，无需等待从此摆脱噪音、电量、维护的烦恼，一部分的算力也可以用于云挖矿算力出租。这部分意味着投资的瞬间回本，但是收益是不及自主挖矿。项目适当考虑这部分的市场是为了更好的风险控制。<br />
挖 &nbsp;矿 &nbsp;我们主要的收入来源于矿机挖矿。我们会同时采购比特币矿机和显卡矿机。项目会在收益高的项目之间做自动切换。<br />
托 &nbsp;管 &nbsp;如果有额外的矿场的位置，我们将会做一些托管业务。托管业务的收入主要是电费的差价和托管费用。<br />
其 &nbsp;他 &nbsp;我们会根据市场需求引进其他品类高收益矿机以及各类Token空投，为投资者提供稳健的投资收益选择。<br />
&nbsp;<br />
