<h3 style="text-align:center;">
	<strong>IPFS主网上线后可兑换IPFS矿机</strong><strong></strong> 
</h3>
<p>
	<strong><br />
</strong> 
</p>
<p>
	<strong><br />
</strong> 
</p>
<p>
	<strong><br />
</strong> 
</p>','zh-cn','','1','0','0','0');
<p class="p" align="center" style="margin-left:0.0000pt;text-align:center;">
	矿机销售与算力托管合约
</p>
<p class="p" align="justify" style="margin-left:0.0000pt;text-align:justify;">
	<b>一、</b><b>矿机的购买</b> 
</p>
<p class="MsoNormal" style="text-indent:21pt;">
	1、矿机销售以人民币定价，用户完成下单并支付成功后，订单无法撤销；
</p>
<p class="MsoNormal">
	<b>二、矿机的部署与算力转化</b><b></b> 
</p>
<p class="MsoNormal" style="text-indent:21pt;">
	1、威睿信公司出售的矿机，以矿机厂商的官方网站公布的额定速率为用户转化算力值。
</p>
<p class="MsoNormal" style="text-indent:21pt;">
	2、用户完成下单并支付成功后，威睿信公司在72小时内完成矿机的运输、部署、测试等工作，并在72小时整点完成算力转化。
</p>
<p class="MsoNormal" style="text-indent:21pt;">
	<span>（注：矿机预售等特殊情况需要延长算力转化时间的，会在认购前提前说明</span>)
</p>
<p class="MsoNormal">
	<b>三、收益的分配</b><b></b> 
</p>
<p class="MsoNormal" style="text-indent:21pt;">
	<span>所托管的矿机算力采用</span> PPLNS （Pay Pre Last N Shares)进行收益的分配。
</p>
<p class="MsoNormal" style="text-indent:21pt;">
	1、默认情况下所有在威睿信公司托管的算力连接到矿池Antpool.com 挖矿。
</p>
<p class="MsoNormal" style="text-indent:21pt;">
	2、如果Antpool.com 长时间出现维护，无法连接等故障，威睿信公司有权将算力切换到其他矿池挖矿。切换矿池后，收益将改成PPS(Pay Per Share)方式分配。
</p>
<p class="MsoNormal" style="text-indent:21pt;">
	3、算力从Antpool.com切换到其他矿池期间的收益损失，将按PPS方式补偿。
</p>
<p class="MsoNormal">
	<b><span>四、</span>PPLNS&nbsp;分配方式的具体说明</b><b></b> 
</p>
<p class="p" style="margin-left:0.0000pt;">
	1、<span>当矿池产生</span>1个新的区块并达到6个网络确认的时候，矿池会将爆块信息和收益传递给威睿信公司；
</p>
<p class="p" style="margin-left:0.0000pt;">
	2、威睿信公司以收到爆块信息的时间点为收益分配时间，根据每个用户在当前时刻下所拥有的算力值占该类型矿机的算力总量的比例进行分配；
</p>
<p class="p" style="margin-left:0.0000pt;">
	&nbsp; &nbsp; &nbsp;注意: 威睿信公司收到爆块信息的时间有可能受到网络确认延时、网络故障、网站维护、程序故障等原因影响，收益分配时间产生延迟；如果期间产生算力的转移，以威睿信公司分配时刻为时间点，算力的拥有者享有分配的挖矿收益。
</p>
<p class="MsoNormal">
	<b><span>五、</span>PPS&nbsp;分配方式的具体说明</b><b></b> 
</p>
<p class="p" style="margin-left:0.0000pt;text-indent:21.0000pt;">
	1、<span>根据公式</span> 1*10^9*86400*Current Block Reward/当前网络难度/2^32，计算出每MH/s理论收益，并在分配的时刻，根据用户拥有的算力值分配收益。
</p>
<p class="p" style="margin-left:0.0000pt;text-indent:21.0000pt;">
	2、<span>北京时间每天的中午</span>12:00-13:00威睿信公司<span>对所有用户进行</span>1次PPS 收益分配。
</p>
<p class="MsoNormal">
	<b>六、电费与维护费的收取</b> 
</p>
<p class="p" style="margin-left:0.0000pt;text-indent:21.0000pt;">
	1、威睿信公司以<span>挖矿收益</span>20%为标准收取电费与维护费；
</p>
<p class="p" style="margin-left:0.0000pt;text-indent:21.0000pt;">
	2、电费在收益分配的同一时刻收取，同时根据这一<span>时刻的比特币</span>(默认为CoinDesk BPI)的汇率转换成BTC 从用户余额扣除。
</p>
<p class="p" style="margin-left:0.0000pt;text-indent:21.0000pt;">
	3、<span>用户在分配时刻收取的电费为：每</span>GH/s电费X用户当前拥有的算力值。
</p>
<p class="p" style="margin-left:0.0000pt;text-indent:21.0000pt;">
	4、&nbsp;<span>如果用户出现余额不足扣除电费的情况，在下次收益分配时，需补还所欠的电费。</span> 
</p>
<p class="p" style="margin-left:0.0000pt;text-indent:21.0000pt;">
	5&nbsp;、威睿信公司有权根据实际运营情况对电费和维护费进行调整并提前一周在网站和论坛等公布。
</p>
<p class="MsoNormal">
	<b>七、故障与维修</b><b></b> 
</p>
<p class="p" style="margin-left:0.0000pt;text-indent:21.0000pt;">
	1、威睿信公司<span>保障托管算力</span>99.9％的可靠性。
</p>
<p class="MsoNormal">
	&nbsp;<b>八、矿机的赎回</b><b></b> 
</p>
<p class="p" style="margin-left:0.0000pt;text-indent:21.0000pt;">
	1、<span>由于比特币汇率下降或是难度增涨</span>, PPS电费收益比超出90％时，矿机托管合约进入赎回等待期。
</p>
<p class="p" style="margin-left:0.0000pt;text-indent:21.0000pt;">
	2、<span>为保障用户收益，在赎回等待期内，收益分配方式改为</span>PPS方式。并且停止算力交易，关闭交易市场
</p>
<p class="p" style="margin-left:0.0000pt;text-indent:21.0000pt;">
	3、<span>如果由于汇率上升，</span>PPS电费收益比连续10天低于90%，则收益分配方式恢复为PPLNS方式。
</p>
<p class="p" style="margin-left:0.0000pt;text-indent:21.0000pt;">
	4、<span>在合约等待期内，如果分配时刻电费高于收益补偿，且电费高于收益的情况连续出现</span>10天，威睿信公司有权对矿机进行停机处理，则矿机合约进入赎回期。
</p>
<p class="p" style="margin-left:0.0000pt;text-indent:21.0000pt;">
	5、矿机合约进入赎回期之前，威睿信公司不接受任何形式的矿机赎回申请。
</p>
<p class="p" style="margin-left:0.0000pt;text-indent:21.0000pt;">
