矿机销售与算力托管合约<br />
<br />
一、矿机的购买<br />
1、矿机销售以人民币定价，用户完成下单并支付成功后，订单无法撤销；<br />
二、矿机的部署与算力转化<br />
1、威睿信公司出售的矿机，以矿机厂商的官方网站公布的额定速率为用户转化算力值。<br />
2、用户完成下单并支付成功后，威睿信公司在72小时内完成矿机的运输、部署、测试等工作，并在72小时整点完成算力转化。<br />
（注：矿机预售等特殊情况需要延长算力转化时间的，会在认购前提前说明)<br />
三、收益的分配<br />
所托管的矿机算力采用 PPLNS （Pay Pre Last N Shares)进行收益的分配。<br />
1、默认情况下所有在威睿信公司托管的算力连接到矿池Antpool.com 挖矿。<br />
2、如果Antpool.com 长时间出现维护，无法连接等故障，威睿信公司有权将算力切换到其他矿池挖矿。切换矿池后，收益将改成PPS(Pay Per Share)方式分配。<br />
3、算力从Antpool.com切换到其他矿池期间的收益损失，将按PPS方式补偿。<br />
四、PPLNS 分配方式的具体说明<br />
1、当矿池产生1个新的区块并达到6个网络确认的时候，矿池会将爆块信息和收益传递给威睿信公司；<br />
2、威睿信公司以收到爆块信息的时间点为收益分配时间，根据每个用户在当前时刻下所拥有的算力值占该类型矿机的算力总量的比例进行分配；<br />
&nbsp; &nbsp; &nbsp;注意: 威睿信公司收到爆块信息的时间有可能受到网络确认延时、网络故障、网站维护、程序故障等原因影响，收益分配时间产生延迟；如果期间产生算力的转移，以威睿信公司分配时刻为时间点，算力的拥有者享有分配的挖矿收益。<br />
五、PPS 分配方式的具体说明<br />
1、根据公式 1*10^9*86400*Current Block Reward/当前网络难度/2^32，计算出每MH/s理论收益，并在分配的时刻，根据用户拥有的算力值分配收益。<br />
2、北京时间每天的中午12:00-13:00威睿信公司对所有用户进行1次PPS 收益分配。<br />
六、电费与维护费的收取<br />
1、威睿信公司以挖矿收益20%为标准收取电费与维护费；<br />
2、电费在收益分配的同一时刻收取，同时根据这一时刻的比特币(默认为CoinDesk BPI)的汇率转换成BTC 从用户余额扣除。<br />
3、用户在分配时刻收取的电费为：每GH/s电费X用户当前拥有的算力值。<br />
4、 如果用户出现余额不足扣除电费的情况，在下次收益分配时，需补还所欠的电费。<br />
5 、威睿信公司有权根据实际运营情况对电费和维护费进行调整并提前一周在网站和论坛等公布。<br />
