额定算力：10.5TH/s的±5%<br />
墙上功耗：1432W+7%（比特大陆APW7-1600瓦电源，AC / DC 93％的效率，25℃环境温度）<br />
电源效率：94J/TH + 10%（墙上，AC / DC 93％的效率，25°C的环境温度）<br />
客定电压：11.6～13.0V<br />
外形尺寸：435毫米（L）*215毫米（W）*325毫米（H）<br />
冷却：2×12038风扇<br />
工作温度：0℃至40℃<br />
工作湿度：5%RH-95%RH，非凝露<br />
网络连接：以太网<br />
噪音：76dB<br />
整机重量（不包含包装）：4.2kg<br />
电源连接方式：每块算力板三个PCIE接口都需要连接，推荐使用独立电源给整机供电，非独立电源情况下，3个算力板可以分别连接至不同的电源，但是每块算力板不能连接多个电源，并保证算力板最后通电。<br />
<br />
注意事项：<br />
1.机箱变形或者散热片脱落，请不要通电，联系售后处理。<br />
2.不能使用两个电源带同一个算力板。<br />
