4、在合约等待期内，如果分配时刻电费高于收益补偿，且电费高于收益的情况连续出现10天，威睿信公司有权对矿机进行停机处理，则矿机合约进入赎回期。<br />
5、矿机合约进入赎回期之前，威睿信公司不接受任何形式的矿机赎回申请。<br />
6、矿机合约进入赎回期后，用户必须在7日内提交赎回申请。<br />
7、根据矿机厂商发布的矿机额定速率，用户可以选择赎回与所购买型号的矿机等额的算力，不足一台矿机额定速率的算力将不支持赎回。不同类型的算力不可相互转换。<br />
8、用户提交赎回申请时需支付下架费以及国内运费，海外用户需支付下架费，从矿场发往出口港的运费以及海外快递运费。<br />
